import React, { Component, Provider, Router, Header, Switch, Route, Dashboard, history, store} from 'react';
import LoginForm from './components/auth/LoginForm'; // added
import PrivateRoute from './components/common/PrivateRoute'; // added
import RegisterForm from './components/auth/RegisterForm'; // added

//import { loadUser } from './actions/auth'; // added

class App extends Component {
  // added
  // componentDidMount() {
  //   store.dispatch(loadUser());
  // }

  render() {
    return (
      <Provider store={store}>
        <Router history={history}>
          <Header />
          <Switch>
            <PrivateRoute exact path='/' component={Dashboard} /> // updated
            <Route exact path='/register' component={RegisterForm} /> // added
            <Route exact path='/login' component={LoginForm} /> // added
          </Switch>
        </Router>
      </Provider>
    );
  }
}

export default App;
